import React from "react";
import "../../App.css";
import "./AboutMe.css";

function AboutMe() {
  return (
    <div>
      <h1 className="aboutMe">About Me</h1>
      <p className="summary">
        I am a software engineer with over four years of experience in Web and
        Game Development. I have a passion for learning and creating all sorts
        of applications. I enjoy getting to work with others to develop new and
        creative projects.
      </p>
    </div>
  );
}

export default AboutMe;
